    contracted_intermediate = -1.00 * einsum('ac,bd,jl,ke,ei->abjicdlk', kd[v, v], kd[v, v], kd[o, o], f[o, v], t1, optimize=['einsum_path', (0, 1), (1, 2), (0, 2), (0, 1)])
    cc_j_doubles_doubles +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abjicdlk->abijcdlk', contracted_intermediate)  + -1.00000 * einsum('abjicdlk->bajicdlk', contracted_intermediate)  +  1.00000 * einsum('abjicdlk->baijcdlk', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('ac,bd,klij->abjicdlk', kd[v, v], kd[v, v], g[o, o, o, o], optimize=['einsum_path', (0, 1, 2)])
    cc_j_doubles_doubles +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abjicdlk->bajicdlk', contracted_intermediate) 
    contracted_intermediate =  1.00 * einsum('bd,ik,lacj->abjicdlk', kd[v, v], kd[o, o], g[o, v, v, o], optimize=['einsum_path', (0, 1, 2)])
    cc_j_doubles_doubles +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abjicdlk->abjicdkl', contracted_intermediate)  + -1.00000 * einsum('abjicdlk->abjidclk', contracted_intermediate)  +  1.00000 * einsum('abjicdlk->abjidckl', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('bd,jk,laci->abjicdlk', kd[v, v], kd[o, o], g[o, v, v, o], optimize=['einsum_path', (0, 1, 2)])
    cc_j_doubles_doubles +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abjicdlk->abjicdkl', contracted_intermediate)  + -1.00000 * einsum('abjicdlk->abjidclk', contracted_intermediate)  +  1.00000 * einsum('abjicdlk->abjidckl', contracted_intermediate) 
    contracted_intermediate = -1.00 * einsum('ad,ik,lbcj->abjicdlk', kd[v, v], kd[o, o], g[o, v, v, o], optimize=['einsum_path', (0, 1, 2)])
    cc_j_doubles_doubles +=  1.00000 * contracted_intermediate + -1.00000 * einsum('abjicdlk->abjicdkl', contracted_intermediate)  + -1.00000 * einsum('abjicdlk->abjidclk', contracted_intermediate)  +  1.00000 * einsum('abjicdlk->abjidckl', contracted_intermediate) 
